(1, 'visimisi', 'VISI MISI KELURAHAN KARAH', '<div class=\"features wow bounceInUp clearfix\">\r\n            <center><i class=\"fa fa-diamond\" style=\"color: #f058dc;\"></i><h4><b>VISI</b></h4>\r\n            <p>TERDEPAN DALAM PELAYANAN KITA CIPTAKAN KECAMATAN JAMBANGAN BERSIH DAN HIJAU</p>\r\n        </center></div>\r\n        <div class=\"features wow bounceInUp clearfix\">\r\n            <center><i class=\"fa fa-diamond\" style=\"color: #589af1;\"></i><h4><b>MISI</b></h4></center>\r\n            <ol>\r\n              <li><div>MENINGKATKAN SISTEM PEMERINTAHAN YANG DEMOKRATIS, BERKEADILAN DAN TRANSPARAN</div></li>\r\n              <li><div>MEWUJUDKAN PENATAAN LINGKUNGAN MASYARAKAT YANG BERSIH, HIJAU DAN INDAH</div></li>\r\n              <li><div>MENINGKATKAN KESEJAHTERAAN MASYARAKAT MELALUI PEMBANGUNAN SOSIAL MASYARAKAT DAN SEKTOR INFORMAL</div></li>\r\n              <li><div>MENGEMBANGKAN KEHIDUPAN MASYARAKAT YANG HARMONIS DAN BERTOLERANSI</div></li>\r\n            </ol>\r\n        </div>', NULL, '2020-04-13 01:30:50', '2020-04-13 01:52:47'),
(2, 'visimisipkk', 'VISI MISI TP-PKK', '<div class=\"features wow bounceInUp clearfix\">\r\n            <center><i class=\"fa fa-diamond\" style=\"color: #f058dc;\"></i><h4><b>VISI</b></h4>\r\n            <p>TERWUJUDNYA KELUARGA YANG BERIMAN DAN BERTAQWA KEPADA TUHAN YANG MAHA ESA, BERAKHLAK MULIA DAN BERBUDI LUHUR, SEHAT SEJAHTERA, LAHIR DAN BATIN</p>\r\n        </div>\r\n        <div class=\"features wow bounceInUp clearfix\">\r\n            <center><i class=\"fa fa-diamond\" style=\"color: #589af1;\"></i><h4><b>MISI</b></h4></center>\r\n            <ol>\r\n              <li><div>MENINGKATKAN PEMBENTUKAN KAREKTER KELUARGA MELALUI PENGHAYATAN, PENGAMALAN PANCASILA, KEGOTONG ROYONGAN SERTA KESETARAAN DAN KEADILAN GENDER.</div></li>\r\n              <li><div>MENINGKATKAN PENDIDIKAN DAN EKONOMI KELUARGA MELALUI BERBAGAI UPAYA KETRAMPILAN DAN PENGEMBANGAN KOPERASI</div></li>\r\n              <li><div>MENINGKATKAN KETAHANAN KELUARGA MELALUI PEMENUHAN PANGAN, SANDANG DAN PERUMAHAN SEHAT DAN LAYAK HUNI.</div></li>\r\n              <li><div>MENINGKATKAN PENGELOLAAN GERAKAN PKK MELIPUTI KEGIATAN PENGORGANISASIAN DAN PENINGKATAN SUMBER DAYA MANUSIA.</div></li>\r\n            </ol>\r\n        </div>', NULL, '2020-04-20 01:59:48', NULL),
(3, 'tujuan', 'TUJUAN PKK', 'GERAKAN PKK BERTUJUAN MEMEBERDAYAKAN KELUARAGA UNTUK MENINGKATKAN KESEJAHTERAAN MENUJU TERWUJUDNYA KELUARGA YANG BERIMAN DAN BERTAQWA KEPADA TUHAN YANG MAHA ESA, BERAKHLAK MULIA DAN BERBUDI LUHUR, SEHAT SEJAHTERA, LAHIR DAN BATIN.', NULL, '2020-04-20 01:59:48', NULL);

